import React from 'react';
import './index3signup.css';
import { FaFacebook, FaGoogle } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';

const SignUp = () => {
  const navigate = useNavigate();

  
  const handleLogin = () => {
    navigate('/Login');
  };

 
  const handleSignUp = (e) => {
    e.preventDefault(); 
    alert('Form submitted sucessfully');
  };

  return (
    <div className="signup-container">
      <button className="circle"></button>
      <button className="circles"></button>
      <h1>Sign Up</h1>
      <form onSubmit={handleSignUp}>
        <label>Full name</label>
        <input type="text" placeholder="Arlene Mccoy" />

        <label>E-mail</label>
        <input type="email" placeholder="prelookstudio@gmail.com" />

        <label>Password</label>
        <div className="password-container">
          <input type="password" placeholder="********" />
          <span className="eye-icon">&#128065;</span>
        </div>

        <button type="submit" className="signup-btn">
          Sign Up
        </button>
      </form>

      <p className="login-text">
        Already have an account? <span onClick={handleLogin}>Login</span>
      </p>

      <div className="social-signup">
        <p>Sign up with</p>
        <div className="social-buttons">
            
          <button className='social-btn facebook'>
          <a href='https://www.facebook.com/login/'>
            <FaFacebook size={20} color="blue" />
            Facebook
            </a>
          </button>
          
          <button className="social-btn google">
          <a href='https://accounts.google.com/'>
            <FaGoogle color="red" />
            Google
            </a>
          </button>
        </div>
      </div>
    </div>
  );
};

export default SignUp;
